export default (function(a,b,c,d,e,f,g,h,i,j,k,l){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:d,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:b,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:b,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:b,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:d,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}},{id:2784,attributes:{type:b,item_lang:{data:{id:3451,attributes:{title:"Renfield",slug:"renfield"}}}}},{id:2788,attributes:{type:b,item_lang:{data:{id:3455,attributes:{title:"The Killer",slug:"the-killer"}}}}},{id:2790,attributes:{type:b,item_lang:{data:{id:3457,attributes:{title:"The Color Purple",slug:"the-color-purple"}}}}},{id:2798,attributes:{type:d,item_lang:{data:{id:3465,attributes:{title:"Silo",slug:"silo"}}}}},{id:2802,attributes:{type:d,item_lang:{data:{id:3469,attributes:{title:"The Night Agent",slug:"the-night-agent"}}}}}],meta:{pagination:{page:h,pageSize:25,pageCount:h,total:10}}},UMtBiA9yws:{data:{id:1553,attributes:{imdbId:"tt0167203",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BZGQyODhhN2QtNTM4Ni00YmI0LWI2NjctM2Y1OWU2NzkwZDc0XkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg",type:b,ratings:[{Source:"Internet Movie Database",Value:"5.6\u002F10"},{Source:"Rotten Tomatoes",Value:"10%"},{Source:"Metacritic",Value:"33\u002F100"}],item_lang:{data:{id:2216,attributes:{title:f,plot:"Kuki, a divorced Italian socialite, changes her life after a serious car crash. She accepts a marriage proposal from Paolo Gallmann, a man she doesn't know well, and she moves to Kenya with him and her young son to start a cattle ranch. Challenges beset her, not the least of which is Paulo's love of danger and his leaving for days on end to hunt and fish with pals. She must face fierce storms, roving lions, venomous snakes, and murderous poachers, and she must find accommodation with a neighboring tribe. Her mother entreats her to return home. Can Kuki live her dream, tame Paolo, guide her son safely past the perils and errors of youth, and serve Africa?",slug:"i-dreamed-of-africa"}}},books:{data:[{id:8140,attributes:{title:f,description:i,thumbnail:j,authors:[c],firstBook:true,published:k,publisher:g,subtitle:a}},{id:8141,attributes:{title:f,description:i,thumbnail:j,authors:[c],firstBook:e,published:k,publisher:g,subtitle:a}},{id:8142,attributes:{title:l,description:"The follow-up to I DREAMED OF AFRICA, in which Kuki Gallman recounts her continuing fascination with the beauty and drama of the Kenyan highlands, through a series of episodes which evoke the mysterious magic of life in Africa. First published in 1994.",thumbnail:a,authors:[c],firstBook:e,published:"1995-02-01",publisher:a,subtitle:"True Stories from the Author of I Dreamed of Africa"}},{id:8143,attributes:{title:l,description:"Stunningly repackaged, Kuki Gallmann's African Nights vividly portrays the harsh and beautiful landscapes of Africa. Africa evokes a deep sense of mystery. It is a place that retains what most of the world has lost: space, roots, traditions, awesome beauty, true wilderness, rare animals, and extraordinary people. In this wonderful and haunting collection of stories, Kuki Gallmann writes of her life in Africa, where every day brings challenge and adventure. African Nights is a treasury of memories, in which fascinating people and places are brought to life. It he healing powers Africa can have on those who embrace the land as a place of mystery, superstition, danger, and beauty. 'Captures perfectly the magic of Kenya, creating an almost overwhelming picture of beauty and drama, pain and joy, death and resurrection . . . Her discovery of African culture, with its mystery and danger, is recounted in spare, lyrical prose' New York Times 'Powerful, poetic, unbearably moving: I wept' Clare Francis (on I Dreamed of Africa) Kuki Gallmann was born near Venice and moved to Kenya in 1972 with her husband and young son. Following their deaths, she set up the Gallmann Memorial Foundation to promote new ways of combining development and conservation, and to provide sponsorship for the education of Kenyans. Her first book, I Dreamed of Africa, was published in 1991 to international acclaim and it became a world-wide bestseller. She lives in Kenya with her daughter and her dogs.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=01SJAwAAQBAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[c],firstBook:e,published:"2014-05-29",publisher:g,subtitle:a}},{id:8144,attributes:{title:"Night of the Lions",description:"Originally published in 1999 by Viking, an illustrated collection of stories about the African land and people, written by the author of AFRICAN NIGHTS and I DREAMED OF AFRICA.",thumbnail:a,authors:[c],firstBook:e,published:"2001-01-01",publisher:a,subtitle:a}}]}}},meta:{}}},prerenderedAt:1694069554969}}("","movie","Kuki Gallmann","series",null,"I Dreamed of Africa","Penguin UK",1,"‘Often, at the hour of day when the savannah grass is streaked with silver, and pale gold rims the silhouettes of the hills, I drive with my dogs up to the Mukutan, to watch the sun setting behind the lake, and the evening shadows settle over the valleys and plains of the Laikipia plateau.’ Kuki Gallmann’s haunting memoir of bringing up a family in Kenya in the 1970s first with her husband Paulo, and then alone, is part elegaic celebration, part tragedy, and part love letter to the magical spirit of Africa.","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=KXhO7mn_bp4C&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","2012-03-29","African Nights"))